import {
    TextField,
    FormControl,
    InputLabel,
    Select,
    MenuItem,
  } from "@mui/material";
const DynamicPricing = () => {
  return (
    <div class="grid grid-cols-3 divide-x">
      <div>
        <h1 className="bg bg-red-300">computer Selection creteria</h1>
        <div>
        <TextField
                    id="Ram"
                    label="Ram"
                    variant="standard"
                    color="secondary"
                    size=""
                    required
                    // value={editAccountDetail.DepositAccount}
                    // onChange={(e) =>
                    //     setEditAccountDetail({
                    //     ...editAccountDetail,
                    //     DepositAccount: e.target.value,
                    //   })
                    // }
                    name="Ram"
                  />
                  </div>
                  <div>
                  <TextField
                    id="CPU"
                    label="CPU"
                    variant="standard"
                    color="secondary"
                    size=""
                    required
                    // value={editAccountDetail.DepositAccount}
                    // onChange={(e) =>
                    //     setEditAccountDetail({
                    //     ...editAccountDetail,
                    //     DepositAccount: e.target.value,
                    //   })
                    // }
                    name="CPU"
                  />
                  </div>
                  <div>
                  <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  currency
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editSoleOtherBank.CurrencyId = event.target.value)
                  }
                  labelId="loanType"
                  id="loanTypeSelected"
                  label="loanType"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>                 
                </Select>
              </FormControl>
                  </div>
      </div>
      <div>
        <h1 className="bg bg-green-500" bg bg-red-300>Ubuy</h1>
        
      </div>
      <div>
      <h1 className="bg bg-green-200" bg bg-red-300>Jiji</h1>
        
        </div>
    </div>
  );
};

export default DynamicPricing;
